?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта компания была основана в далеком 1918 году известным часовым мастером Джорджесом Шэрэном, который всегда имел мечту – открыть собственную компанию по производству часов и выпустить свою коллекцию. Название компании происходит от испанского словосочетания «Yo mido», что в переводе означает «Я измеряю». Уже в то время, о часах Джорджеса отзывались великолепно: эти часы великолепно отражают все технические нововведения и прогрессивные дизайнерские решения. В 20-х годах 20-го века, компания Mido выпускает широкий ассортимент экземпляров часов, которые были изготовлены в, популярном тогда, стиле арт-деко. Помимо этого, ассортимент был пополнен ювелирными и спортивными моделями, а также инновационными формами. Интересно, что в 1930-х годах, компания Mido получила большой заказ на изготовление часов, которые были стилизованны и похожи на многие, популярные в то время марки машин, такие как Chevrolet и Bugatti. На данный момент, компания производит великолепные, качественные и надежные часы, которые завоевали своих почитателей по всему миру.</span></span></p>
 
